B.aOs=new A.ax("Existen muchas medidas de rentabilidad. En conjunto, estas medidas permiten a los analistas evaluar las utilidades de la empresa respecto a un nivel determinado de ventas, cierto nivel de activos o la inversi\xf3n de los propietarios. Sin utilidades, una compa\xf1\xeda no podr\xeda atraer capital externo.",null,null,B.b4,null,null,null,null,null,null)
