B.azH=new A.bC(B.bM,B.aOn,null)
B.aOH=new A.ax("El apalancamiento se refiere a los efectos que tienen los costos fijos sobre el rendimiento que ganan los accionistas. Por \u201ccostos fijos\u201d queremos decir costos que no aumentan ni disminuyen con los cambios en las ventas de la compa\xf1\xeda. Las empresas tienen que pagar estos costos fijos independientemente de que las condiciones del negocio sean buenas o malas. Estos costos fijos pueden ser operativos, como los derivados de la compra y la operaci\xf3n de la planta y el equipo, o financieros, como los costos fijos derivados de los pagos de deuda. Por lo general, el apalancamiento incrementa tanto los rendimientos como el riesgo. Una empresa con m\xe1s apalancamiento gana mayores rendimientos, en promedio, que aquellas que tienen menos apalancamiento, pero los rendimientos de la empresa con mayor apalancamiento tambi\xe9n son m\xe1s vol\xe1tiles.",null,null,B.b4,null,null,null,null,null,null)
B.azI=new A.bC(B.bM,B.aOH,null)
B.aOT=new A.ax("La raz\xf3n de actividad o los \xedndices de actividad miden la rapidez con la que diversas cuentas se convierten en ventas o efectivo, es decir, en entradas o salidas. ",null,null,B.b4,null,null,null,null,null,null)
B.azJ=new A.bC(B.bM,B.aOT,null)
